import React, { useState } from 'react';
import './Navbar.css';
import logoo from '../assets/logo.png';

const Navbar = ({ scrollToSection, aboutRef, servicesRef, blogRef, resourceRef }) => {
  const [menu, setMenu] = useState("");

  return (
    <div className='navbar'>
      <div className='nav-logo'>
        <img src={logoo} alt="logo" />
        {/* <p>Tanuja Devang</p> */}
      </div>

      <div className='nav-menu-container'>
        <ul className="nav-menu">
          <li onClick={() => { setMenu("index.html"); }} className="nav-item active">
            Home
          </li>
          <li onClick={() => { setMenu("about"); scrollToSection(aboutRef); }} className={`nav-item ${menu === "about" ? 'active' : ''}`}>
            About
          </li>
          <li onClick={() => { setMenu("services"); scrollToSection(servicesRef); }} className={`nav-item ${menu === "services" ? 'active' : ''}`}>
            Services
          </li>
          <li onClick={() => { setMenu("blog"); scrollToSection(blogRef); }} className={`nav-item ${menu === "blog" ? 'active' : ''}`}>
            Blog
          </li>
          <li onClick={() => { setMenu("resources"); scrollToSection(resourceRef); }} className={`nav-item ${menu === "resources" ? 'active' : ''}`}>
            Resources
          </li>
        </ul>
      </div>
    </div>
  );
};

export default Navbar;
